import { Select } from "antd";
import { useNavigate } from "react-router-dom";



function AdminNavBar(){
    const {Option} = Select;
    const navigate = useNavigate();
    const [selectedUsers, setSelectedUsers] = useState('userMenegment');
    const [selectedStatistics, setSelectedStatistics] = useState('getStatistics');
    const [selectedManegment, setSelectedManegment] = useState('Directory management');
  
    const handleChangeUsers = (value)=>{
        navigate(`${value}`);
    };
    const handleChangeStatistics = (value)=>{
        navigate(`${value}`);
    };
    const handleChangeManegment = (value)=>{
        navigate(`${value}`);
    };
    return(
        <div>
            <Select defaultValue='userMenegment' onChange={handleChangeUsers}>
                <Option value='userBlocking'>Blocking</Option>
                <Option value='orderStatusChange'>Change order status</Option>
            </Select>
            <Select defaultValue='getStatistics' onChange={handleChangeStatistics }>
                <Option value='usersData'>Get users data</Option>
                
            </Select>
            <Select defaultValue='Directory management' onChange={handleChangeManegment}>
                <Option value = 'standart-pizza-list'></Option>
            </Select>
        </div>
    )
}
export default AdminNavBar;
